Ingredients:

1/2 cup chia seeds
1 cup pumpkin seeds
1 cup oatmeal 
1/4 cup flaxseeds
1 cup of dried green split peas or quinoa 
2 cups of amaranth 
1/2 cup sunflower seeds

Blend all the ingredients separately until they become a fine powder. Pay extra attention to the flaxseeds,pumpkin seeds and sunflower seeds because they have high concentration of good oils if you blend them too much they will turn into a paste. After you blend them, separate the clumps very well to prevent humidity. 
Keep it in the fridge for up to 6 weeks.

